 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 06:35:15', '2017-11-17 06:35:15', 'd6ba7a5b-f54f-401e-9625-fa8821a8909e'),
 ('2', '2', 'en_us', 'Homepage', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, 'It’s time to turn doubt into drive.', 'View Workouts', '', 'About', 'Robbie Birdwell', '“As Iron Sharpens Iron, So One Man Sharpens Another.”', 'Proverbs 27:17', '<p>For Robbie Birdwell, fitness is more than a passion—it’s a lifestyle. He’s personally experienced the power of physical conditioning to provide mental, spiritual, and bodily healing. </p>\n<p>Having a diverse background in health and fitness, Robbie specializes in injury prevention, rehabilitation, and functional training. His expertise in correcting mobility issues and faulty movement patterns has helped clients of all types, from injury-plagued couch potatoes to Division 1 college athletes.</p>\n<p>As a certified athletic trainer (through the National Board of Certification for Athletic Training), Robbie earned his bachelor’s degree in athletic training and sports medicine from Baylor University. He went on to receive a master’s degree in kinesiology from the University of North Texas. He worked with several notable athletes throughout his collegiate career including track stars, Jeremy Wariner, Darold Williamson, and Stephen White as well as then up-and-coming NFL players, Robert Griffin III (RG3), Jason Smith, Lance Dunbar, and Zachary Orr.</p>\n<p>Robbie also knows firsthand what it takes to prepare and compete. He played professional arena football in the Indoor Football League (IFL) for two years and competed as a bodybuilder within the physique division for the Better Bodies Championship. </p>\n<p>Robbie’s extensive education and experience have prepared him to offer quality service and care. His goal-oriented approach and customized, research-based workout programs empower clients to be accountable, stay motivated, and have fun!</p>\n<p>When Robbie is not at the gym, he enjoys riding his motorcycle, playing the guitar, and watching football (no surprise!).</p>', NULL, NULL, NULL, 'Services', '<p>Working out, eating healthy, and losing weight does not have to be a chore. </p>\n<p>It should be an energizing, enjoyable, and empowering experience that you look forward to every day. Together, we will overcome your obstacles, push your boundaries and have a ton of fun, making your fitness dreams a reality.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 06:35:17', '2017-11-17 08:04:43', '2aba6aaf-0d2e-4446-8c00-ee14abed3d05'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Localhost. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 06:35:17', '2017-11-17 06:35:17', 'dcace178-b56a-45d8-b454-f05801c73385'),
 ('4', '4', 'en_us', 'Bbr Hero', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 07:59:01', '2017-11-17 07:59:01', 'bbca6f16-8363-4983-a258-cfdb84c3d465'),
